    {
        src: Healthy,
        altText: '',
        caption: '',
        header: '',

    },
    {
        src: Fitness,
        altText: '',
        caption: '',
        header: ''
    }
];

const Home = (props) => {


    return (
        <>
        <style>
          {
            `.custom-tag {
                max-width: 100%;
                height: 500px;
                background: black;
              }`
          }
        </style>
        <UncontrolledCarousel className="custom-tag" items={items}/>
            <Row>
                <Col sm="12">
                    <Card body>
                        <h1 align="center">Community bonding with Sports</h1>
                        <h2 align="center">Trying to look for random people to do sports? <br></br>We are here for loners who wants to do some outdoor activities with other lonely people</h2>
                    </Card>
                </Col>
            </Row>
        </>
    );
}

export default Home;
